import React from "react";
import AdminNav from "./AdminNav";
import SideBar from "./SideBar";

const DashboardPage = () => {
  return (
    <>
      <AdminNav />
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-3 d-md-block">
            <SideBar />
          </div>
          <div className="col-md-9">
            <h1>Dashboard</h1>
          </div>
        </div>
      </div>
    </>
  );
};

export default DashboardPage;
